import "./App.css";
import TopBar from "./Components/TopBar/TopBar";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import Homepage from "./Components/Homepage/Homepage";

const App = () => {
  return (
    <Router>
      <TopBar />
      <Routes>
        <Route exact path="/" element={<Homepage />}>


        </Route>
      </Routes>
    </Router>
  );
};
export default App;
